package co.technobits.topografia.model;

public class Datos {
	
	int vertice;
	double distancia;
	String azimut;
	double N;
	double S;
	double E;
	double W;
	double cooN;
	double cooE;
	
	public Datos() {
		super();
		// TODO Auto-generated constructor stub
	}
	
	public int getVertice() {
		return vertice;
	}
	public void setVertice(int vertice) {
		this.vertice = vertice;
	}
	public double getDistancia() {
		return distancia;
	}
	public void setDistancia(double distancia) {
		this.distancia = distancia;
	}
	public String getAzimut() {
		return azimut;
	}
	public void setAzimut(String azimut) {
		this.azimut = azimut;
	}
	public double getN() {
		return N;
	}
	public void setN(double n) {
		N = n;
	}
	public double getS() {
		return S;
	}
	public void setS(double s) {
		S = s;
	}
	public double getE() {
		return E;
	}
	public void setE(double e) {
		E = e;
	}
	public double getW() {
		return W;
	}
	public void setW(double w) {
		W = w;
	}
	public double getCooN() {
		return cooN;
	}
	public void setCooN(double cooN) {
		this.cooN = cooN;
	}
	public double getCooE() {
		return cooE;
	}
	public void setCooE(double cooE) {
		this.cooE = cooE;
	}
		

}
